function App() {
  const status = [
    {
      title: "Status 1",
    },
    {
      title: "New",
    },
    {
      title: "Working",
    },
    {
      title: "Status 1",
    },
  ];

  return (
    <div className="bg-gray-200 h-full py-16">
      <div className="bg-white rounded shadow-inner grid justify-items-center h-20 w-7/12 mx-auto">
        <div className="w-full flex justify-center m-auto gap-x-10">
          {status.map((item, i) => {
            return (
              <div
                className="h-10 w-80 border border-gray-500 flex justify-center items-center font-semibold"
                key={i}
              >
                {item.title}
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}

export default App;
